    const mapRef = useRef()
	const elementsRef = useRef(features.map(() => createRef()));
	const offsetY = 0; // 0.15;

	useEffect(() => {
		panTo(activeIndex)
	}, [activeIndex])

	useEffect(() => {
		Draggable.create(mapRef.current, {
			// bounds: containerRef.current
			// bounds: { minX: -100, minY: -100, maxX: 100, maxY: 100 }
		})
		
		// center svg in container on first load
		gsap.set(mapRef.current, {
			x: getX(),
			scale: 1
		})
	}, [])

	const panTo = (i) => {
		const el = elementsRef.current[i]?.current
		if (el) {
			gsap.to(mapRef.current, {
				x: '+=1',
				y: '+=1',
				scale: 1, // 2
				duration: 0.5,
				ease: 'Power1.linear',
				onUpdate: onUpdate(el)
			})
		}
    }

	const zoomOut = (e) => {
        gsap.to(mapRef.current, {
			x: getX(),
			y: 0,
            scale: 1,
            duration: 0.5,
            ease: 'Power1.linear'
        })
		setActiveIndex(null)
    }

	

    const onUpdate = (el) => {
        let rect = el.getBoundingClientRect();
		let centerX = window.innerWidth / 2;
        // let centerY = window.innerHeight / (2 - offsetY); // offset for nav 
		let centerY = MAP_CONTAINER_HEIGHT;
        let deltaX = centerX - (rect.x + rect.width / 2);
        let deltaY = centerY - (rect.y + rect.height / 2);
      
        return function () {
            gsap.to(mapRef.current, {
                x: '+=' + deltaX,
                y: '+=' + deltaY,
                scale: 1, // 1.5
                duration: gsap.utils.clamp(0, 1, this.duration() - this.time()),
                overwrite: true,
                ease: 'Power1.linear'
            })
        }
    }

	const getColour = (index) => {
		return (index === activeIndex) ? COLOUR_ACTIVE : COLOUR_INACTIVE
	}

